import React from 'react';
import './App.css';
import HomeScreen from './components/HomescreenComponent/HomeScreen';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";


function App() {
  return (
    <div className="app">

      <Router>
        <Switch>
          <Route exact path="/">
              {/*Home Screen*/}
              <HomeScreen />
          </Route>
        </Switch>

      </Router>
    </div>
  );
}

export default App;
